export default transactions => {
  const date = new Date().toUTCString();
  let income;
  let expenses;
  let predictedIncome;
  let predictedExpenses;

  transactions.map(transaction => {
    console.log(date);
    console.log(new Date(transaction.date).toUTCString());
  });
};
